// ── Image sources ──
const IMGS = {
  img1: "data:image/jpeg;base64,",
  img2: "data:image/jpeg;base64,",
  img3: "data:image/jpeg;base64,",
  img4: "data:image/jpeg;base64,",
  img5: "data:image/jpeg;base64,",
  img6: "data:image/jpeg;base64,",
};

// Inject images into bg-photo elements
document.addEventListener('DOMContentLoaded', () => {
  const order = ['img1', 'img2', 'img3', 'img4', 'img5', 'img6'];
  document.querySelectorAll('.bg-photo img').forEach((el, i) => {
    el.src = IMGS[order[i]];
  });
});

// ── Timer & Hearts ──
const start = new Date('2025-12-14T00:00:00');

    function update() {
      const diff = Date.now() - start;
      const totalSecs = Math.floor(diff / 1000);
      const secs  = totalSecs % 60;
      const mins  = Math.floor(totalSecs / 60) % 60;
      const hrs   = Math.floor(totalSecs / 3600) % 24;
      const days  = Math.floor(totalSecs / 86400);

      const secsEl = document.getElementById('seconds');
      const prev   = secsEl.textContent;
      const next   = String(secs).padStart(2,'0');

      document.getElementById('days').textContent    = String(days).padStart(3,'0');
      document.getElementById('hours').textContent   = String(hrs).padStart(2,'0');
      document.getElementById('minutes').textContent = String(mins).padStart(2,'0');
      secsEl.textContent = next;

      if(prev !== next) {
        secsEl.classList.add('tick');
        setTimeout(() => secsEl.classList.remove('tick'), 280);
      }
    }

    update();
    setInterval(update, 1000);

    // Floating hearts
    const container = document.getElementById('hearts');
    const chars = ['♥','♡','💕','✦','·'];

    function spawnHeart() {
      const el = document.createElement('div');
      el.className = 'heart-float';
      el.textContent = chars[Math.floor(Math.random() * chars.length)];
      el.style.left     = Math.random() * 100 + 'vw';
      el.style.fontSize = (0.7 + Math.random() * 1.2) + 'rem';
      const dur = 9 + Math.random() * 10;
      el.style.animationDuration = dur + 's';
      el.style.animationDelay   = (Math.random() * 3) + 's';
      el.style.color = Math.random() > 0.5 ? '#ff9a3c' : '#ff6b1a';
      container.appendChild(el);
      setTimeout(() => el.remove(), (dur + 3) * 1000);
    }

    for(let i = 0; i < 18; i++) setTimeout(spawnHeart, i * 350);
    setInterval(spawnHeart, 1100);
